export function setSorting(sorting) {
  return {
    type: 'SET_SORTING',
    sorting
  }
}

export function setPage(page) {
  return {
    type: 'SET_PAGE',
    page
  }
}

export function setSearchQuery(searchQuery) {
  return {
    type: 'SET_SEARCH_QUERY',
    searchQuery
  }
}
